One-hundred and four five-letter, phono-orthographically legal non-words were randomly selected from the ELP database as well. Half of them (i.e., 52) were randomly selected to be presented as targets; the other half was instead used as unrelated non-word primes. None of the non-words contained any existing English morpheme. Both the words and non-words used in the experiments are reported in the appendix below. In addition, all items had a reported error rate smaller than 10%, so to ensure that they were all clearly distinguishable by participants.

### Procedure {#sec-exp1-methods-proc}

Each recruited participant was assigned one of two word lists, which differed only in the relatedness of the prime with respect to the target; otherwise, the two lists presented the same set of target words and nonwords (i.e., 104 pairs for each list). In one list, the three conditions (the high- and low-frequency word conditions, and the non-word condition) had half of the target items being preceded by themselves (the *repetition* condition) and half of the target items being preceded by one of the unrelated primes belonging to the same frequency bin (the *unrelated* condition). In the other list, these assignments were reversed. The order of stimulus presentation was randomized for each participant.

After being recruited in the _Prolific_ online platform, participants were asked to click on a link redirecting them to the Labvanced online service. During the experiment, they were asked to perform a lexical decision task by pressing either the 'J' (for word) or 'F' (for non-word) keys on their keyboard. Each trial consisted of three different stimuli appearing at the center of the screen: a series of five hashes (#####) presented for 500 ms, followed by a prime word presented for 33 ms, and finally the target word; the target word disappeared from the screen as soon as a decision was made.

Participants were given 5 breaks throughout the experiment. When the experiment was over, the participants were then redirected to Prolific in order to validate their submission. The median time to finish the experiment was 6 minutes. Each participant was paid with a standard rate of GBP 9/hour.

## Data analysis {#sec-exp1-analysis}

Analysis scripts and an abridged version of the data collected can be found online (<https://osf.io/vn3r2>), and consisted of 297,598 observations in total. We performed the same three steps of analysis described for experiment 1 (@sec-exp1-analysis).

### Step 1: subject and item performance {#sec-exp1-analysis-performance}

Item and subject error rates were calculated. The item error rate was never above 14%, so no item was excluded from analysis. 19 subjects were removed because their error rate was above 30%. Thus, a total of 269,652 observations and 2,593 participants were included in further analyses.

### Step 2: prime durations {#sec-exp1-analysis-primeTime}

Prime fluctuations were dealt with in the same way as in experiment 1 (@sec-exp1-analysis-primeTime). The mean (mean = 32.32 ms, sd = 15) and the median (median = 33 ms)  prime durations were closer to the intended value (33 ms). The same prime duration cut-off set for experiment 1 (i.e., any trial whose prime duration was out of the 25-60ms range) removed 13 % of the trials. No participant was excluded, for a total of 237,287 observations.

### Step 3: RT analysis {#sec-exp1-analysis-RT}

After removing the incorrect responses, similarly to experiment 1 (@sec-exp1-analysis-RT), 0.51% of the trials were excluded if their corresponding RT was below 200 ms or above 1800 ms. Finally, 249 subjects were removed because the number of trials within the same condition was less than 7 (i.e., about half of the total number of trials being presented within the same condition, i.e. 13). A total of 210,889 observations and 2,341 subjects were included in the statistical analysis below. 

## Results {#sec-exp1-results}

@tbl-exp1-statsResults below report the descriptive statistics of the experiment. Priming effects were calculated by subtracting the mean RT to the related condition to the mean RT from the unrelated condition. We ran two different analyses, for both RT and error data. First, we ran a 2x2 repeated-measures ANOVA (condition, 3 levels: high vs. low vs. non-word; primetype, 2 levels: unrelated vs. repetition) on the by-subject averaged data, paired with planned comparisons between related and unrelated primetype for each condition. In addition, a Generalized Linear Mixed Model (GLMM) analysis on the raw RT and the raw accuracy data (rather the by-subject means or error rates used in the ANOVA analyses). Unlike linear mixed-effect models, GLMMs do not assume normal distribution of the data, and are therefore particularly useful for non-normally distributed data such as RTs and accuracy. For the RT data, a Gamma distribution was used; for the accuracy data, a binomial distribution was used instead, both with an identity link between fixed effects and the dependent variable [@LoAndrews2015]. To prevent converge failure, the model was kept as simple as possibly, with condition, primetype, and their interaction as fixed effects, and subjects and items as random intercepts. Before fitting the model, the contrasts were also set to sum-to-zero contrasts (i.e., by using the R function `contr.sum()`) to facilitation interpretation of main and interaction effects. The fitting was performed by using the `lme4` R-package [@BatesEtal2015] with the Laplace approximation technique, using 1 million iterations and the BOBYQA optimizer to help convergence. Then, we used the function `Anova()` from the `car` R-package [@FoxWeisberg2019] to obtain estimates and probability values for fixed effects calculated for Type-III sums of squares. 

In the word analysis, the ANOVA analysis showed significant main effects (condition: *F*(1, 2340)=1572, *p*<.0001; primetype: *F*(1, 2340)=1113, *p*<.0001) and their interaction *F*(1, 2340)=52.48, *p*<.0001). Planned comparisons confirmed statistically significant repetition priming effects for both word conditions (*MOP_HF*=18 ms, *CI_95%*=[16 20], *t*(2340)=19.7, *p*<.0001; *MOP_LF* = 28 ms, *CI_95%*=[26 30], *t*(2340)=27.8, *p*<.0001), with the low-frequency word repetition priming effect being 10 ms larger than the high-frequency word repetition priming effect. This FAE effect was statistically significant (*M_FAE*=10 ms, *CI_95%*=[7 13]), *t*(2340)=7.24, *p*<.0001l). A very small but statistically significant inhibitory priming effect was observed in the non-word condition (*MOP_NW*=-2 ms, *CI_95%*=[-4 0], *t*(2340)=-2.33, *p*<.0001). Similarly, the GLMM analysis confirmed that both main effects (condition: $\chi^2=2978.35, p<.0001$; primetype: $\chi^2=1531.12, p<.0001$) and their interaction ($\chi^2=870.27, p<.0001$) were significant. 

In the error analysis, the ANOVA analysis revealed significant effects for both main effects (condition: *F*(1, 2340)=392.5, *p*<.0001; primetype: *F*(1, 2340)=380.5, *p*<.0001) and interaction *F*(1, 2340)=55.47, *p*<.0001). Planned comparison revealed significant priming effects in the form of fewer errors in the repeated compared to unrelated trials in the all conditions (high: *t*(2340)=9.95, *p*<.0001; low: *t*(2340)=16.9, *p*<.0001; non-word: *t*(2340)=-3.27, *p*=.001). As in the ANOVA error analysis, both main effects (condition: $\chi^2=30.45, p<.0001$; primetype: $\chi^2=108.88, p<.0001$) and their interaction ($\chi^2=307.57, p<.0001$) were significant.

