pooled_std <- function(sd1, sd2, n1, n2) {
  dfs = n1+n2-2
  term1 = sd1^2*(n1-1)
  term2 = sd2^2*(n2-1)

  sp = sqrt((term1+term2)/dfs)
  return(sp)
}

d_value <- function(m1, m2, sd1, sd2, n1, n2){
  sp = pooled_std(sd1, sd2, n1, n2)
  d = (m1-m2)/sp
  return(d)
}

